december 2009 (utc)it is not common (because almost every defendant in murder cases opts for a fast-track trial) but it may happen.a fast-track trial is a trial where no actual trial is involved. i'll try to explain it. a criminal proceeding in italy consists of many phases:
1. preliminary investigations;
2. preliminary hearing;
3. trial;
4. appeals.after the preliminary hearing, the judge only decides whether or not the evidence gathered so far is enough to sustain a case in court. if so, he sends the defendant before the judge of the trial, where he will be convicted or acquitted; if not, the judge sort of acquits the defendant.a defendant can, though, choose to give up his right to a trial. he will be, then, tried by the judge of the preliminary hearing, who will hand down a judgement, based upon the evidence gathered so far.since this is a reduction of the defendant's rights, it must be he who asks for a fast-track trial. in exchange for that, he is compensated with a lighter sentence. if there are two or more defendants, one may opt for a fast-track trial and the other choose to stick to the standard pattern. in this case, since it would be unfair (or so italians think) to let the wishes of one of them take precedence over those of the other, the two defendants are tried separately, even though they committed the same crime.   14:05, 11

